import React from "react";

const OrderSummary = (props) => {
  return (
    <div>
      <h3>Your order</h3>
      <p>Your Burger</p>
      <ul>
        {Object.keys(props.ingredientsNames).map((el) => (
          //console.log('el', el)
          <li key={el}>
            {props.ingredientsNames[el]} : {props.ingredientsNames[el]}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default OrderSummary;
